import React, { Component } from 'react';

class Content extends Component {

  componentdidmount(){
    fatch('https://api.themoviedb.org/3/discover/movie?page=1&api_key=943cc4f77f40afc90157127eac5065c1')
    .then(response => response.json())
    .then(json => cosole.log(json))
  }

}
